import React from "react";
import Todo from "./Todo";

const TodoList = ({ todos, inputText }) => {
  return (
    <div>
      <Todo />
      <h3>List:</h3>
      {todos.map((todo) => {
        <p key={todo.id}>Name: {todo.title}</p>;
      })}
    </div>
  );
};

export default TodoList;
